kontext:
###deines Frühlings;
Die >>>Balsamdüfte deiner Kraft<<< 
Sind Fülle und Wonne###

###hoch im sonnigen blauen
 >>>Äther der Wolken<<< Zug;

Als sollt###

###;
Still mit den >>>Gräsern des Hügels<<< 
Spielte die Abendluft.###

###frommen Bitte
Spricht jeder >>>Athemzug des Schlafs<<< dich an;
Leis###

###Bach
Und sieht dem >>>Lauf der hellen Wellen<<< nach;
Der Andre###

###
Der kann verschmähn die >>>Kränze eines Tages<<< ;
Verlangend Herz,###

###

Im Rücken dämmerte der >>>Brauch der heutgen Welt<<< ;
Was rings um###

###;
Es glimmt kein >>>Strahl der Freude<<< 
Mehr in des Mönches###

###,
Wo vordem das >>>Paradies der Menschheit<<< ;
Teppiche, gewebt###

###;

Und ihr im >>>Schmuck der langen Zöpfe<<< ,
Ihr Schwarzwaldmädchen,###

###frohe Lenzgeschick
Nicht ein >>>Wort des Himmels<<< kündet;
Nur sein###

###Mondenstrahl,
Aus jedem >>>Weh'n der Luft<<< ;
Er athmet ein###

###Freude schafft,
Die >>>Würde des Menschen<<< zu höhnen;
Die###

###;
Dann ist die >>>Feier der Natur<<< .
Sie prangt nicht###

###Bitte,
Spricht jeder >>>Athemzug des Schlafs<<< dich an;
Leis###

###;
Ich bin vom >>>Tau des Glückes<<< groß genährt.
Wo###

###
Nie soll der Glaube sitzen zu Gerichte;
Vergebens nicht durch sieben Säkula
Lauscht' ich dem >>>Genius der Weltgeschichte<<< .

Die Formen wechseln, doch der Geist besteht;
Einst kommt die Zeit, wo reinen Liebesdranges###

###;
So! — so! — nun euer Herz sich stähle;
Vor Dijon war's: die >>>Pässe der Vogesen<<< 
Bedrohte Garibaldis bunte Schar,
Bourbaki kam von der Loire,
Das hart bedrängte Belfort zu erlösen###

### >>>Gott der buschigen Höhen<<< , entdeckt,
Der sonst die Wanderer neckt und schreckt;
Doch jüngst als ich unter der Eiche###

###,
Rufst du zum >>>Strande der Gefährten<<< Schar;
„Wohin###
